import React from 'react';

function Footer() {
    return (
        <footer className="footer mt-4 py-4 bg-dark text-light">
            <div className="container text-center">
                <h5>MU</h5>
                <p>
                    Sam Electronic Shop provides the latest electronics at affordable prices. 
                    From phones to laptops, we have everything you need to stay connected and equipped with the latest tech.
                </p>
            </div>
        </footer>
    );
}

export default Footer;
